import React from 'react';

const SobreMim = () => {
    return (
        <section className="sobreMim">
            <h2>Sobre Mim</h2>
            <p>
                Sou uma desenvolvedora Back-End apaixonada por tecnologia, com sólida experiência em linguagens como Node.js e Java, além de um conhecimento diversificado em várias outras tecnologias. Ao longo da minha trajetória, busquei constantemente aprimorar minhas habilidades para entregar soluções que não apenas atendem às necessidades dos meus clientes, mas que também superam suas expectativas.

                Meu compromisso com a qualidade e a eficiência se reflete em cada projeto que desenvolvo, onde aplico as melhores práticas de programação e desenvolvimento ágil. Acredito que a inovação é a chave para resolver desafios complexos, e estou sempre em busca de novas ferramentas e metodologias que possam otimizar o desempenho das aplicações que crio.

                Estou entusiasmada em colaborar em projetos que tenham impacto real, contribuindo para a transformação digital e a evolução dos negócios. Vamos trabalhar juntos para transformar suas ideias em soluções robustas e eficazes!</p>
        </section>
    );
};

export default SobreMim;
